import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
// import { Observable } from 'rxjs';
import { IResponse } from '../models/search-response.model';
import { IItem } from '../models/search-item.model';

const HTTP_URL = 'https://www.googleapis.com/youtube/v3/';
const HTTP_KEY = 'AIzaSyCaIsx1V1ywnN-Selao8dbuKMf2_a-BOuY';

@Injectable({
  providedIn: 'root',
})
export class YoutubeService {
  constructor(private http: HttpClient) {}

  response!: IResponse;

  items: IItem[] = [];

  setItems() {
    // this.items = this.response.items;
    this.http.get<IResponse>(`${HTTP_URL}search?key=${HTTP_KEY}&type=video&part=snippet&maxResults=8&q=js`).subscribe((resp) => {
      console.log(resp);
      this.items = resp.items;
    });
  }

  getItems(): IItem[] {
    return this.items;
  }

  // getItem(id: string): IItem {
  //   return this.response.items.filter((i) => i.id === id)[0];
  // }
}
